  <chunk id='67727'><![CDATA[Folkmängd år 1983 och framåt redovisas enligt regional indelning den 1 januari efterföljande år. \r\n \r\nFolkökning för år 1968–2009 definieras i denna tabell som skillnaden mellan folkmängden vid årets början och årets slut.]]></chunk>
