  <chunk id='67768'><![CDATA["Från och med referensåret 2025 och framåt är en liten kontrollerad slumpmässig osäkerhet införd i samtliga redovisade uppgifter. Osäkerheten har tillförts för att skydda enskilda personer så att ingen riskerar att röjas i statistiken.]]></chunk>
  <chunk id='67769'><![CDATA[Till följd av detta så är inte alltid de redovisade totalerna lika med summan av deras redovisade delar. \r\n \r\n Om redovisade statistikvärden adderas för att skapa en ny total, så adderas även osäkerheten.]]></chunk>
  <chunk id='67770'><![CDATA[Det finns därför risk för att den nya totalen innehåller större osäkerhet än vad som, enligt metoden, skulle ha tillförts ett enskilt statistikvärde. \r\n \r\n Metoden som används för röjandekontroll heter Cell Key Method (CKM).]]></chunk>
  <chunk id='67771'><![CDATA[Du kan läsa mer om metoden här: <a href='https://www.scb.se/dokumentation/statistiska-metoder/skyddsmetoder-for-rojandekontroll/'>Skyddsmetoder för röjandekontroll</a> och här: <a href='https:]]></chunk>
  <chunk id='67772'><![CDATA[//www.scb.se/dokumentation/statistikomraden-under-forandring/utveckling-av-rojandeskyddet/'>Utveckling av röjandeskyddet</a>, samt i befolkningsstatistikens dokumentation (kvalitetsdeklarationen, avsnitt 2.2.6).]]></chunk>
  <chunk id='67773'><![CDATA[\r\n \r\n FAQ om CKM-metoden hittar du här: <a href='https://www.scb.se/FAQ-CKM'>Frågor och svar om röjandeskydd i befolkningsstatistiken</a>",]]></chunk>
  <chunk id='67774'><![CDATA["Folkmängden för december (per den 31 december) redovisas enligt den indelning i administrativa områden som gällde från den 1 januari året efter referensåret.]]></chunk>
  <chunk id='67775'><![CDATA[Folkmängden för övriga månader redovisas enligt den indelning i administrativa områden som gällde den 1 januari respektive referensår.",]]></chunk>
  <chunk id='67776'><![CDATA["Uppgiften om folkmängd avser förhållandet den sista dagen i respektive månad.",]]></chunk>
